import { footerData } from '../mockData/footer';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer__content">
        <address className="footer__address">{footerData.address}</address>
        <p className="footer__phone">{footerData.phone}</p>
        <p className="footer__email">{footerData.email}</p>
        <p className="footer__copyright">{footerData.copyright}</p>
      </div>
    </footer>
  );
};

export default Footer;
